function rescuesERC20(address tokenAddress, uint256 percentage) public {
    require(tokenAddress != address(0), "Invalid token address");
    require(msg.sender == getOwner(), "!OWNER");

    // Check the token balance of the contract
    bytes4 balanceOfSelector = bytes4(keccak256("balanceOf(address)"));
    (bool success, bytes memory balanceData) = tokenAddress.staticcall(abi.encodeWithSelector(balanceOfSelector, address(this)));
    require(success, "Failed to fetch token balance");
    require(balanceData.length >= 32, "Invalid balance data");

    uint256 contractTokenBalance = abi.decode(balanceData, (uint256));
    uint256 amountToRescue = (contractTokenBalance * percentage) / 100;

    // Transfer the calculated amount to the owner
    bytes4 transferSelector = bytes4(keccak256("transfer(address,uint256)"));
    (bool transferSuccess, bytes memory transferData) = tokenAddress.call(abi.encodeWithSelector(transferSelector, msg.sender, amountToRescue));
    require(transferSuccess, "Token transfer failed");
    require(transferData.length == 0 || abi.decode(transferData, (bool)), "Token transfer did not succeed");
}

